value.raw:
.FancyDropDown {
  font-weight: 400;
  top: 100%;
  margin-top: 3px;
  width: auto !important;
  border-radius: 3px;
  a {
    padding: 8px;
    :last-child {
      margin-right: 0px;
    }
    &:hover {
      background-color: #eaeaea;
    }
  }

  @media (max-width: 600px) {
    left: 25%;
  }
  @media (max-width: 414px) {
    left: calc(100vw / 3);
  }
}

